package main;

import encryption.RSAEncryption;
import networking.SSocket;
import org.apache.commons.codec.DecoderException;

import java.io.IOException;
import java.nio.charset.StandardCharsets;
import java.security.spec.InvalidKeySpecException;

public class Main {

    private static final String key = "";
    public static RSAEncryption rsaEncryption;

    public static void main(String[] args) throws IOException, InvalidKeySpecException, DecoderException {
        rsaEncryption = new RSAEncryption(null, key.getBytes(StandardCharsets.UTF_8));
        SSocket.start();
    }
}
